text384465.addInnerText('<div id=\"text384465\" aria-live=\"polite\" ><a id=\"text384465anc\" style=\"display:block;height:0px;width:0px;\"></a>\n<table style=\"border-collapse:collapse;top:0px;position:absolute; border-spacing:0; width:100%; height:100%\">\n<tr>\n<td style=\"position: absolute;top:0px;left:0px;box-sizing:border-box;width:100%;vertical-align:top;height:100%;padding:5px\">\n<div style=\'height:100%;width:100%;overflow-y:hidden;overflow-x:hidden;\'>\n\n<p lang=\"en\"  legLH=\"1.229\" style=\"margin-left:0px;text-indent:0px;line-height:1.229;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text384465Font1\" style=\"position:relative;top:-1px;\" >1. CONFIDENTIAL will cease.\n</span ></p >\n<p  legLH=\"1.229\" style=\"margin-left:0px;text-indent:0px;line-height:1.229;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text384465Font1\" style=\"background-color:transparentposition:relative;top:-1px;\" >\n&nbsp;</span ></p >\n<p  legLH=\"1.229\" style=\"margin-left:0px;text-indent:0px;line-height:1.229;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text384465Font1\" style=\"position:relative;top:-1px;\" >2. UNCLASSIFIED will be replaced by OFFICIAL (no changes to handling requirements).</span ><span class=\"text384465Font2\" style=\"background-color:transparentposition:relative;top:-1px;\" >\n</span ></p >\n<p  legLH=\"1.229\" style=\"margin-left:0px;text-indent:0px;line-height:1.229;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text384465Font2\" style=\"background-color:transparentposition:relative;top:-1px;\" >\n&nbsp;</span ></p >\n<p  legLH=\"1.229\" style=\"margin-left:0px;text-indent:0px;line-height:1.229;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text384465Font1\" style=\"position:relative;top:-1px;\" >3. For Official Use Only (FOUO) will be replaced by OFFICIAL: Sensitive (no changes to handling requirements)</span ><span class=\"text384465Font2\" style=\"background-color:transparentposition:relative;top:-1px;\" >\n</span ></p >\n<p  legLH=\"1.284\" style=\"margin-left:0px;text-indent:0px;line-height:1.041;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text384465Font3\" style=\"background-color:transparent\" >\n&nbsp;</span ></p >\n<p  legLH=\"1.229\" style=\"margin-left:0px;text-indent:0px;line-height:1.229;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text384465Font1\" style=\"position:relative;top:-1px;\" >4. Sensitive Dissemination Limiting Markers (DLMS) will be replaced with optional Information Management Markers (IMMs)</span ><span class=\"text384465Font2\" style=\"background-color:transparentposition:relative;top:-1px;\" >\n</span ></p >\n<p  legLH=\"1.229\" style=\"margin-left:0px;text-indent:0px;line-height:1.229;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text384465Font2\" style=\"background-color:transparentposition:relative;top:-1px;\" >\n&nbsp;</span ></p >\n<p  legLH=\"1.229\" style=\"margin-left:0px;text-indent:0px;line-height:1.229;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text384465Font1\" style=\"position:relative;top:-1px;\" >5. Sensitive: Cabinet will be replaced with the Caveat \'CABINET\'</span ><span class=\"text384465Font2\" style=\"background-color:transparentposition:relative;top:-1px;\" >\n</span ></p >\n<p  legLH=\"1.229\" style=\"margin-left:0px;text-indent:0px;line-height:1.229;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text384465Font2\" style=\"background-color:transparentposition:relative;top:-1px;\" >\n&nbsp;</span ></p >\n<p  legLH=\"1.229\" style=\"margin-left:0px;text-indent:0px;line-height:1.229;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text384465Font2\" style=\"position:relative;top:-1px;\" >&nbsp;\n</span ></p >\n\n\n</div></td>\n</tr>\n</table>\n</div>\n');
